import React from "react";

const GameCard = ({ gameName }) => {
  return (
    <div
      style={{
        display: "flex",
        alignItems: "center",
        border: "1px solid #ccc",
        padding: "10px",
        marginBottom: "10px",
      }}
    >
      {/* Placeholder for game image */}
      <div
        style={{
          width: "50px",
          height: "50px",
          backgroundColor: "#ddd",
          marginRight: "10px",
        }}
      ></div>
      <div>{gameName}</div>
    </div>
  );
};

export default GameCard;
